const userApiBaseUrl = "https://tmentor.xyz/user_system"

async function LoginByThirdParty(thirdPartyId, thirdPartyAccessToken) {
    const response = fetch(userApiBaseUrl + '/user/thirdParty/login',{
        method: 'POST',
        body: JSON.stringify({
            "thirdPartyId": thirdPartyId, 
            "thirdPartyAccessToken": thirdPartyAccessToken
        }),
    });

    const data = await response.json()
    console.log(data)
    return response;
}

export default LoginByThirdParty
